import React from 'react'
import Home from './home.js'
export default class Expe extends React.Component{

    constructor(props){
        super(props);
        this.state = {
            status: 0,
        }
    }    

    render() {
        const state = this.state.status;
        let active 

        switch (state) {

            case 0 :
                return <Home/>
            case 1 :
                return <Form/>;
            case 2 :
                return <SButton/>;
            case 3 :
                return <Animation/>;
            case 4 :
                return <Question/>;
            case 5 :
                return <Result/>;
            case -1 : 
                return <Info/>
            default :
                return null;
        }

    }

}
